    //     setCurrentComponentIndex((prevIndex) => (prevIndex - 1 + components.length) % components.length);
    //     console.log('prev', currentComponentIndex);
    // }
    const HandleSubmit = (e) => {
        e.preventDefault()


    }
    return (
        <AppContext.Provider value={{}}>
            <form onSubmit={HandleSubmit} className='card  mx-auto mt-5 justify-content-center align-items-center' style={{ width: "80vw", height: '80vh' }} >

                {/* <div className='card  mx-auto mt-5 justify-content-center align-items-center' style={{ width: "80vw", height: '80vh' }}>
                    {submit ? <div>
                        {components[currentComponentIndex]}
                    </div>
                        : <div>
                            <Successful />
                        </div>}
                </div>

                <div className='d-flex'>
                    {currentComponentIndex !== 0 && < div className='d-flex  mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2'>
                        <button type='button' onClick={prevHandelClick} style={{ width: '10vw' }} className='btn btn-primary '>Prev</button>
                    </div>}

                    {currentComponentIndex === components.length - 1 ?
                        <div className='d-flex  mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2'>
                            <button onClick={HandleSubmit} type="submit" style={{ width: '10vw' }} className='btn btn-primary '>Submit</button>
                        </div> :
                        <div className='d-flex  mx-auto border-secondary m-2 justify-content-between p-2 align-items-center gap-2'>
                            <button type='button' onClick={handleButtonClick} style={{ width: '10vw' }} className='btn btn-primary '>Next....</button>
                        </div>}
                </div> */}
                <div>
                    <input type="date" />
                    <select name="" id="">
                        <option value="10:00AM">10:00AM</option>
                        <option value="10:30AM">10:30AM</option>
                        <option value="11:00AM">11:00AM</option>
                        <option value="11:30AM">11:30AM</option>
                        <option value="12:00PM">12:00PM</option>
                        <option value="12:30PM">12:30PM</option>
                        <option value="01:00PM">01:00PM</option>
                        <option value="01:30PM">01:30PM</option>
                        <option value="02:00PM">02:00PM</option>
                        <option value="02:30PM">02:30PM</option>
                        <option value="03:00PM">03:00PM</option>
                        <option value="03:30PM">03:30PM</option>
                        <option value="04:00PM">04:00PM</option>
                    </select>

                </div>
                <div>
                    <div className='d-flex gap-2  ' >
                        <div class="input-group mb-3 p-1  "  >
                            <span class="input-group-text" id="inputGroup-sizing-default">First Name</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                        <div class="input-group mb-3 p-1 " >
                            <span class="input-group-text" id="inputGroup-sizing-default">Last Name</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                    </div>
                    <div className='d-flex gap-2'>
                        <div class="input-group mb-3 p-1">
                            <span class="input-group-text" id="inputGroup-sizing-default">Email Id</span>
                            <input type="email" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                        <div class="input-group mb-3 p-1">
                            <span class="input-group-text" id="inputGroup-sizing-default">Mobile No</span>
                            <input type="number" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" />
                        </div>
                    </div>
                    <div className='d-flex gap-2 ' >
                        <div class="input-group mb-3 p-1">
                            <span class="input-group-text" id="inputGroup-sizing-default">Address</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                        <div class="input-group mb-3 p-1 ">
                            <span class="input-group-text" id="inputGroup-sizing-default">City</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                    </div>
                    <div className='d-flex gap-2 '>
                        <div class="input-group mb-3 p-1 ">
                            <span class="input-group-text" id="inputGroup-sizing-default">State</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                        <div class="input-group mb-3 p-1 ">
                            <span class="input-group-text" id="inputGroup-sizing-default">Appointment for</span>
                            <input type="text" class="form-control" aria-label="Sizing example input" aria-describedby="inputGroup-sizing-default" required />
                        </div>
                    </div>
                </div>



            </form>
        </AppContext.Provider >
    )
}

export default Booking
